        console.log(this.state.animals)
        return (
            <div className="dogs">
                {
                    this.state.animals.map(dog => {
                        if (dog.photo) {
                            return (
                                <div key={dog.id} className="card" id={dog.id} >
                                    <img src={dog.photo && dog.photo.small} width="300px" alt="Dog" />
                                    <div class="container">
                                        <h5>{dog.name}</h5>

                                        <p>{dog.city.mia}</p>
                                    </div>
                                </div>

                            )
                        }

                    })
                }
            </div >
        )
    }


}
export default dogsForAdoption
